// pages/ExamDetails.js

import React from 'react';
import ExamList from '../components/ExamList';

const exams = [
  { id: 1, name: 'Exam 1', date: 'April 10, 2023' },
  { id: 2, name: 'Exam 2', date: 'April 15, 2023' },
  { id: 3, name: 'Exam 3', date: 'April 20, 2023' },
  // ... more exams data
];

const ExamDetails = () => {
  return (
    <div>
      <h1>Exam Details</h1>
      <ExamList exams={exams} />
    </div>
  );
};

export default ExamDetails;
